import GlobalStyle from '../styles/GlobalStyles';
import { Container, Main, Title } from '../styles/Landing';
import '../assets/graduation'

const Index = () => (
    <Container>

        <Main>
            <img src="../assets/graduation-cap.svg" alt=""/>
            <Title></Title>
        </Main>


        <GlobalStyle />
    </Container>
)

export default Index;
